#doing the part for detecting keypress		
keypress:
li $s1, 0xffff0000
lw $t8, 0($s1)

beq $t8, 1, keypress_happened
jal platform
#for the moving enemy
la $t4, enemy_position
add $a0, $t4, $t7
lw $t4, 0($a0)
jal clear_enemy1
add $t7,$t7,4
andi $t7,$t7,127
la $t4, enemy_position
add $a0, $t4,$t7
lw $t4, 0($a0)
jal move_enemy1
#this is to set the moving of the platform
la $t4, platform_position
add $a0, $t4, $t9
lw $t4, 0($a0)
jal clear_floating
la $t4, platform2_position
add $a0, $t4, $t9
lw $t4, 0($a0)
jal clear_floating1
add $t9, $t9,4
andi $t9, $t9, 127
la $t4, platform_position
add $a0, $t4, $t9
lw $t4, 0($a0)
jal move_floating
#this is to set the moving platform 2

andi $t9, $t9, 127
la $t4, platform2_position
add $a0, $t4, $t9
lw $t4, 0($a0)
jal move_floating1

#sleep
li $v0, 32
li $a0, 50

syscall
jal check_health
jal check_gravity

j keypress 




keypress_happened:

lw $t2, 4($s1)
li $v0, 1
move $a0, $a3
move $a1, $a3
andi $a0,$a0, 0xFF
sra $a1,$a1,8
beq 	$t2, 0x61, respond_to_a						# ASCII code of 'a': 0x61
beq	$t2, 119, respond_to_w						# ASCII code of 'w': 0x77
beq	$t2, 100, respond_to_d					# ASCII code of 'd': 0x64
beq	$t2, 0x72, respond_to_r	
beq	$t2, 115, respond_to_s				# ASCII code of 'r': 0x72
beq	$t2, 113, respond_to_q	
j keypress


respond_to_q:
li $v0,10
syscall

respond_to_s:
beq $a1, 57, keypress 
jal clear_character
add $a3,$a3,256
jal move_character
j keypress
						
respond_to_a:
beq $a0, 8, keypress # if it is on the border, no moving
jal clear_character
sub $a3,$a3,4
jal move_character
j keypress

respond_to_d:
beq $a0, 224, keypress
jal clear_character
add $a3,$a3,4
jal move_character
j keypress

respond_to_w:
beq $a1, 0, keypress
li $t0, BASE_ADDRESS
add $t0, $t0, $a3
add $t0, $t0, 1540 
lw $t0, 0($t0)
bne $t0, BLACK, keypress
li $a2, 0
j up_loop
up_loop:
beq $a2,12, keypress
jal clear_character
sub $a3,$a3,256
jal move_character
add $a2, $a2,1
li $v0, 32
li $a0, 20 # Wait one second (1000 milliseconds)
syscall
j up_loop

# doing the checking part
check_health:
li $t0, BASE_ADDRESS
li $s0, POISON
add $t0, $a3,$t0
add $t0, $t0, 1540 
lw $t1, 0($t0)
beq $t1, POISON, decrease_health
add $t0, $t0, -528
lw $t1, 0($t0)
beq $t1, RED, draw_win
beq $t1, YELLOW, draw_win
beq $t1, ENEMY2, decrease_health1
beq $t1, ENEMY, decrease_health
add $t0,$t0, 48
lw $t1, 0($t0)
beq $t1, ENEMY, decrease_health
beq $t1, ENEMY2, decrease_health1
jr $ra

