draw_win: 

	    li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, win_page        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, 4096        # $t3 stores total units	
            win_start: 
	    beq $t2, $t3, exit_start
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            add $t2, $t2, 1        # increment counter

            j win_start
            
draw_lose: 

	    li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, lose_page        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, 4096        # $t3 stores total units	
            lose_start: 
	    beq $t2, $t3, exit_start
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            addi $t2, $t2, 1        # increment counter
            j lose_start

exit_start:      # Call wait_for_enter function to wait for the Enter key press
li $s1, 0xffff0000
lw $t8, 0($s1)

beq $t8, 1, keypress_happened2
li $v0,32
li $a0,40
syscall
j exit_start

keypress_happened2:
lw $t2, 4($s1)
beq	$t2, 0x72, respond_to_r0				# ASCII code of 'r': 0x72
beq	$t2, 113, respond_to_q 
j      exit_start  
																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																																								
